import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';
import AlertMessage from '../AlertMessage';
import "../Styles/NoticeResultSection.css";

export default function UpdateSection(props) {

    //usingContext

    //for alert
    const [showAlert, setShowAlert] = useState(false);

    const [show, setShow] = useState(false);
    
    const [userinfo,setUserinfo] = useState({
        ename: props.userName,
        ephone: props.userPhone,
        edob: props.userDob,
        eaddress: props.userAddress,
        egrade: props.userGrade,
    })
    
    // To open and close model box
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    
    //To update notice
    const handleUpdate = (e) =>{
        e.preventDefault();
        handleClose();
        setNotice({
             ename: userinfo.ename,
            ephone: userinfo.userPhone,
            edob: props.userDob,
            eaddress: props.userAddress,
            egrade: props.userGrade,

            ename: notice.ename,
            eusernotice: notice.eusernotice,
            id: notice.id
        });

        //updateNotice(notice.id, notice.ename, notice.eusernotice)
        setShowAlert(true);
    }
    //fucntions used
    const onchange = (e)=>{
        setUserinfo({...userinfo,[e.target.name]:e.target.value})
    }

    return (
        <>
        <Button className=' header-btn  ' onClick={handleShow}>
            <i className="fa-solid fa-pen-to-square" ></i>Edit Profile
        </Button>

        <Modal show={show} onHide={handleClose}>
            <Modal.Header closeButton>
            <Modal.Title>Edit Profile</Modal.Title>
            </Modal.Header>
            <Form onSubmit={handleUpdate}>
            <Modal.Body>
            <h4>Edit Your Profile Here</h4>
                <Form.Group className="mb-3">
                    <Form.Label>Name</Form.Label>
                    <Form.Control type="text" minLength={10} required placeholder="Enter Notice Title" value={userinfo.ename} onChange={onchange} name='ename'  />
                    <Form.Text className="text-muted">
                    Title must be longer than 10 letters.
                    </Form.Text>
                </Form.Group>

                <Form.Group className="mb-3" >
                    <Form.Label>Phone Number</Form.Label>
                    <Form.Control type="text" minLength={10} required placeholder="Enter Notice" value={userinfo.ephone} onChange={onchange} name='ephone'  />
                    <Form.Text className="text-muted">
                        Notice must be longer than 10 letters.
                    </Form.Text>
                </Form.Group>

                <Form.Group className="mb-3" >
                    <Form.Label>Date Of Birth</Form.Label>
                    <Form.Control type="date" minLength={10} required placeholder="Enter Notice" value={userinfo.edob} onChange={onchange} name='edob'  />
                    <Form.Text className="text-muted">
                        Notice must be longer than 10 letters.
                    </Form.Text>
                </Form.Group>

                <Form.Group className="mb-3" >
                    <Form.Label>Address</Form.Label>
                    <Form.Control type="text" minLength={10} required placeholder="Enter Notice" value={userinfo.eaddress} onChange={onchange} name='eaddress'  />
                    <Form.Text className="text-muted">
                        Notice must be longer than 10 letters.
                    </Form.Text>
                </Form.Group>
                <Form.Group className="mb-3" >
                    <Form.Label>Grade</Form.Label>
                    <Form.Control type="text" minLength={10} required placeholder="Enter Notice" value={userinfo.egrade} onChange={onchange} name='egrade'  />
                    <Form.Text className="text-muted">
                        Notice must be longer than 10 letters.
                    </Form.Text>
                </Form.Group>

            </Modal.Body>
            <Modal.Footer>
            <Button className="additem-btn icondelete" onClick={handleClose}>
                Close
            </Button>
            <Button className="additem-btn iconedit" type='submit'>
                Update Notice
            </Button>
            </Modal.Footer>
            </Form>
        </Modal>
        {showAlert && <AlertMessage severe="success" timeout="3000" message="Notice updated successfully!" />}
    </>
    );
}
